const App = () => {
  const { category } = useAppContext();
  const [posts, setPosts] = useState([]);
  const [filteredPosts, setFilteredPosts] = useState([]);

  useEffect(() => {
    const storedPosts = JSON.parse(localStorage.getItem("editorData")) || {};
      if (Object.keys(storedPosts).length === 0) {
      data.forEach((post) => {
        const existingData = JSON.parse(localStorage.getItem("editorData")) || {};
        const id = uuidv4();
        existingData[id] = post;
        localStorage.setItem("editorData", JSON.stringify(existingData));
      });
    }

    const postsArray = Object.keys(storedPosts).map(key => ({
      id: key,
      ...storedPosts[key],
    }));
    setPosts(postsArray);
  }, []);

  useEffect(() => {
    const filtered = category === "All Posts" 
      ? posts 
      : posts.filter(post => post.category === category);
      
    setFilteredPosts(filtered);
  }, [category, posts]);

  return (
    <>
      <Home posts={filteredPosts} />
    </>
  );
};

export default App;
